import CardData from './CardInfo';
import './index.css';

const Card=({cardInfoData})=>{
   //console.log(cardInfoData);
   //const entries = Object.entries(props);
   //console.log(entries);
    return(
        <>
            {cardInfoData.map((item)=>{
               setTimeout(()=>{

                
                const {Link, Category, Title,Image} = item;
                //destructring did not work for image url (undefined)
                //let id = item.id;
                //let Category = item.Category;
                //let Image = item.Imgsrc;
                //let Link = item.Link;
                //let Title = item.Title;
                //let key=item.id
                
            
               
            //console.log(item);
            console.log(Category)
            console.log(Title);
            console.log("Hello");
            console.log(Image);
            
        
            
                
                return(
                    <>
                        <div className='cards'>
                            <div className='card'>
                                <img src={Image} alt="Movie Photos" />
                                <div className='cardInfo'>
                                    <span className='category'>{Category}</span>
                                    <h3 className='title'>{Title}</h3>
                                    <a href={Link} target='_blank'>
                                        <button type="button">Watch Now</button>
                                    </a>
                                </div>
                            </div>
                        </div>
                    

                    </>
                )

            },1000)

            } 
        
       // },1000  )  
        
        )}
            
        </>

    );

};

export default Card;
